import './NavBar.scss';
import { Link } from 'react-router-dom';
import { ReactComponent as Logo } from '../../Logo/Logo.svg';

const NavBar = () => {
  return (
    <div className='NavBar'>
      <Link to='/'>
        <Logo />
      </Link>
    </div>
  )
}

export default NavBar;
